import Home from "./pages/Home";
import Ring from './pages/Ring';
import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <div>
          <Link to="/"></Link>
        </div>
        <div>
          <Link to="/ring"></Link>
        </div>
      </div>
      <Routes>
        <Route path="/" element={<Home/>}>
        </Route>
        <Route path="/ring" element={<Ring/>}>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
